Defibrillator and Monitor made by Hewlett Packard for US Military
NSN# REDACTED199

Unit powers up and charges.....But I haven't zapped myself with them. can be used by plugging into standard jack and will charge up to use on the go.
The EKG monitoring works and the printer even has paper that shows your heart rhythm. Includes the gel that is used on the paddles.

Per an NSN search, info listed below

DEFIBRILLATOR MONITOR RECORDER: 120/230V 50/60HZ AC OR DC

120/230 VOLT,50/60 HZ,AC OR DC; WITH REUSABLE CONTAINER; PORTABLE; 

OPERATES FROM SELF-CONTAINED BATTERIES OR LINE POWER; BATTERIES SUPPLIED WITH THE UNIT; 
THE MONITOR-RECORDER MODULE AARE SEPERATE FOR INDEPENDENT USE; EACH MODULE W/VISUAL AND/OR LOW

BATTERY WARNING ALARMS; THE DEFIBRILLATOR MODULE INCLUDES ADULT EXTERNAL PADDLES; ENERGY RANGE OF 40-320 JOULES AND 2 INTERMEDIATE VALUES; AND DEFIBRILLATOR PADDLES WHICH ALSO SERVE AS ECG ELECTRODES; 

THE MONITOR-RECORDER MODULE INCLUDES NON-FADE DISPLAY;

5 LEAD16 PIN CONNECTOR; FULLY SHEILDED 6 FT (1.8 METER) ELECTRODE CABLE; 4 HR CONTINUOUS OPERATION W/O USE OF EXTERNAL POWER SOURCE; AND 30 MIN HEART ACTIVITY RECORDING TIME

Will accept trades...guns, ammo, body armor..make me an offer!
